#include "pic/picdata_pic_ghulmil_com.h"
extern const uint16_t test_img_128x128[];
extern const uint16_t test_img_128x160[];

int main() {
    stdio_init_all();
    gpio_pull_up(19);
    gpio_pull_up(20);
    gpio_pull_up(21);
    st7735_lcd_init(pio0);
    printf("init.\n");
    st7735_fill_screen_dma(ST7735_BLACK);
    sleep_ms(500);
    for(uint i=0;i<100;i++)
        st7735_draw_pixel(10+i,10,ST7735_RED);
    sleep_ms(500);
    for(uint i=0;i<100;i++)
        st7735_draw_pixel(10+i,20,ST7735_GREEN);
    sleep_ms(500);
    for(uint i=0;i<100;i++)
        st7735_draw_pixel(10+i,30,ST7735_BLUE);
    sleep_ms(500);
    for(uint i=0;i<100;i++)
        st7735_draw_pixel(10+i,40,ST7735_CYAN);
    sleep_ms(500);
    st7735_write_string(10,50,"hello", Font_7x10, ST7735_WHITE, ST7735_BLACK);
    sleep_ms(500);
    st7735_write_string(10,60,"hello", Font_11x18, ST7735_MAGENTA, ST7735_GREEN);
    sleep_ms(500);
    st7735_write_string(10,78,"hello", Font_16x26, ST7735_YELLOW, ST7735_BLUE);
    sleep_ms(500);
    absolute_time_t time_pico;
    uint8_t color_r=0;
    uint8_t color_g=0;
    uint8_t color_b=0;
    uint8_t picture_index=0;
    bool is_inc_color=true;
    while(1){
        time_pico = get_absolute_time();
        if(to_ms_since_boot(time_pico)<5000) {
            if(is_inc_color && color_r<31) color_r++;
            else if(is_inc_color && color_g<63) color_g++;
            else if(is_inc_color && color_b<31) color_b++;
            else if(is_inc_color && color_r==31) is_inc_color=false;
            else if(!is_inc_color && color_r>0) color_r--;
            else if(!is_inc_color && color_g>0) color_g--;
            else if(!is_inc_color && color_b>0) color_b--;
            else if(!is_inc_color && color_r==0) is_inc_color=true;
            st7735_fill_rectangle_dma(10,104,100,20,ST7735_COLOR565(color_r, color_g, color_b));
            sleep_ms(10);
            st7735_draw_image_dma(0,124,128,36,128*50+(const uint16_t *)test_img_128x128_list[picture_index++%(sizeof(test_img_128x128_list)/sizeof(uint32_t))]);
            sleep_ms(20);
        } else if (to_ms_since_boot(time_pico)<5500) {
            st7735_fill_screen_dma(ST7735_BLACK);
            sleep_ms(30); 
        } else if (to_ms_since_boot(time_pico)<11500) {
            st7735_draw_image_dma(0,0,128,128,(const uint16_t *)test_img_128x128_list[picture_index++%(sizeof(test_img_128x128_list)/sizeof(uint32_t))]);
            sleep_ms(30); 
        } else if (to_ms_since_boot(time_pico)<15000) {
            st7735_draw_image_dma(0,0,128,128,(const uint16_t *)blue_parrot_128x128_list[picture_index++%(sizeof(blue_parrot_128x128_list)/sizeof(uint32_t))]);
            sleep_ms(30); 
        } else if (to_ms_since_boot(time_pico)<18000) {
            st7735_draw_image_dma(0,0,128,128,(const uint16_t *)test_img_128x128);
            sleep_ms(30); 
        } else if (to_ms_since_boot(time_pico)<22000) {
            st7735_draw_image_dma(0,0,128,160,(const uint16_t *)test_img_128x160);
            sleep_ms(30); 
        } else if (to_ms_since_boot(time_pico)<22500) {
            st7735_fill_screen_dma(ST7735_BLACK);
            sleep_ms(30); 
        } else if (to_ms_since_boot(time_pico)<28000){
            st7735_draw_image_dma(0,0,128,96,(const uint16_t *)ghulmil_com_128x96);
            sleep_ms(50); 
        } else {
            st7735_draw_image_dma(0,0,128,158,(const uint16_t *)boygirl_dance_128x158_list[picture_index++%(sizeof(boygirl_dance_128x158_list)/sizeof(uint32_t))]);
            sleep_ms(50); 
        }        
    }
}

